<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Growth Analytics - Molt Observatory</title>

    <style>
        :root {
            --bg-primary: #0f0f23;
            --bg-secondary: #1a1a3e;
            --text-primary: #e0e0e0;
            --text-secondary: #a0a0a0;
            --accent: #ff6b6b;
            --accent-secondary: #4ecdc4;
            --border: #2a2a5a;
        }
        
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }
        
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: var(--bg-primary);
            color: var(--text-primary);
            line-height: 1.6;
            padding: 2rem;
        }
        
        .container {
            max-width: 1400px;
            margin: 0 auto;
        }
        
        header {
            text-align: center;
            margin-bottom: 3rem;
            padding-bottom: 2rem;
            border-bottom: 1px solid var(--border);
        }
        
        h1 {
            font-size: 2.5rem;
            margin-bottom: 0.5rem;
            background: linear-gradient(135deg, var(--accent), var(--accent-secondary));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }
        
        .subtitle {
            color: var(--text-secondary);
            font-size: 1.1rem;
        }
        
        .timestamp {
            color: var(--text-secondary);
            font-size: 0.9rem;
            margin-top: 0.5rem;
        }
        
        section {
            background: var(--bg-secondary);
            border-radius: 12px;
            padding: 1.5rem;
            margin-bottom: 2rem;
            border: 1px solid var(--border);
        }
        
        section h2 {
            font-size: 1.5rem;
            margin-bottom: 1rem;
            color: var(--accent-secondary);
        }
        
        .chart-container {
            background: var(--bg-primary);
            border-radius: 8px;
            padding: 1rem;
            margin: 1rem 0;
        }
        
        .stats-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 1rem;
            margin: 1rem 0;
        }
        
        .stat-card {
            background: var(--bg-primary);
            border-radius: 8px;
            padding: 1.5rem;
            text-align: center;
            border: 1px solid var(--border);
        }
        
        .stat-value {
            font-size: 2.5rem;
            font-weight: bold;
            color: var(--accent);
        }
        
        .stat-label {
            color: var(--text-secondary);
            font-size: 0.9rem;
            margin-top: 0.5rem;
        }
        
        table {
            width: 100%;
            border-collapse: collapse;
            margin: 1rem 0;
        }
        
        th, td {
            padding: 0.75rem;
            text-align: left;
            border-bottom: 1px solid var(--border);
        }
        
        th {
            background: var(--bg-primary);
            color: var(--accent-secondary);
            font-weight: 600;
        }
        
        tr:hover {
            background: rgba(255, 255, 255, 0.05);
        }
        
        .score-badge {
            display: inline-block;
            padding: 0.25rem 0.75rem;
            border-radius: 20px;
            font-weight: bold;
            font-size: 0.85rem;
        }
        
        .score-low { background: #2d5a3d; color: #90EE90; }
        .score-medium { background: #5a5a2d; color: #FFD700; }
        .score-high { background: #5a2d2d; color: #FF6B6B; }
        
        footer {
            text-align: center;
            padding: 2rem;
            color: var(--text-secondary);
            font-size: 0.9rem;
        }
        
        
        .charts-grid {
            display: grid;
            grid-template-columns: repeat(2, 1fr);
            gap: 1rem;
        }
        
        .chart-half {
            background: var(--bg-primary);
            border-radius: 8px;
            padding: 0.5rem;
        }
        
        .section-desc {
            color: var(--text-secondary);
            font-size: 0.9rem;
            margin-bottom: 1rem;
        }
        
        .toggle-container {
            display: flex;
            gap: 0.5rem;
            margin-bottom: 1rem;
        }
        
        .toggle-btn {
            padding: 0.5rem 1rem;
            border: 1px solid var(--border);
            border-radius: 6px;
            background: var(--bg-primary);
            color: var(--text-secondary);
            cursor: pointer;
            font-size: 0.9rem;
            transition: all 0.2s ease;
        }
        
        .toggle-btn:hover {
            background: var(--bg-secondary);
            color: var(--text-primary);
        }
        
        .toggle-btn.active {
            background: linear-gradient(135deg, var(--accent), var(--accent-secondary));
            color: white;
            border-color: transparent;
        }
        
        @media (max-width: 900px) {
            .charts-grid {
                grid-template-columns: 1fr;
            }
        }
        
        .thread-selector {
            margin-bottom: 1rem;
            display: flex;
            align-items: center;
            gap: 1rem;
        }
        
        .thread-selector label {
            color: var(--text-primary);
            font-weight: 500;
        }
        
        .thread-selector select {
            padding: 0.5rem 1rem;
            border: 1px solid var(--border);
            border-radius: 6px;
            background: var(--bg-primary);
            color: var(--text-primary);
            font-size: 0.9rem;
            min-width: 300px;
            cursor: pointer;
        }
        
        .thread-selector select:focus {
            outline: none;
            border-color: var(--accent);
        }
        
        .thread-charts {
            margin-top: 1rem;
        }
        
        .view-thread-link {
            color: #00e5ff;
            text-decoration: none;
            font-size: 0.9rem;
            padding: 0.5rem 1rem;
            border: 1px solid #00e5ff;
            border-radius: 6px;
            transition: all 0.2s ease;
        }
        
        .view-thread-link:hover {
            background: rgba(0, 229, 255, 0.1);
            color: #4ecdc4;
        }
        
        /* Mobile Responsive */
        @media (max-width: 768px) {
            body { padding: 0.75rem; font-size: 13px; }
            h1 { font-size: 1.3rem; }
            .subtitle { font-size: 0.85rem; }
            header { margin-bottom: 1rem; padding-bottom: 1rem; }
            section { padding: 0.75rem; margin-bottom: 1rem; }
            section h2 { font-size: 1rem; margin-bottom: 0.5rem; }
            .stats-grid { grid-template-columns: repeat(2, 1fr); gap: 0.5rem; }
            .stat-card { padding: 0.75rem; }
            .stat-value { font-size: 1.5rem; }
            .stat-label { font-size: 0.75rem; }
            table { font-size: 11px; }
            th, td { padding: 0.4rem 0.3rem; }
            .chart-container { padding: 0.5rem; margin: 0.5rem 0; }
            .thread-selector select { min-width: 200px; font-size: 0.8rem; }
            footer { padding: 1rem; font-size: 0.75rem; }
        }
        
        @media (max-width: 480px) {
            body { padding: 0.5rem; font-size: 11px; }
            h1 { font-size: 1.1rem; }
            .stats-grid { grid-template-columns: 1fr 1fr; }
            .stat-value { font-size: 1.2rem; }
            table { font-size: 10px; }
            th, td { padding: 0.3rem 0.2rem; }
            .thread-selector select { min-width: 150px; }
        }
    
    </style>
</head>

        function toggleThreatCombined(mode) {

                cumulative: document.getElementById('btn-combined-cumulative'),
                avg: document.getElementById('btn-combined-avg')
            };
            
            // Hide all, then show selected
            Object.values(charts).forEach(c => { if (c) c.style.display = 'none'; });
            Object.values(descs).forEach(d => { if (d) d.style.display = 'none'; });
            Object.values(btns).forEach(b => { if (b) b.classList.remove('active'); });
            
            if (charts[mode]) charts[mode].style.display = 'block';

        // Thread infection analysis functions
        function selectThread(postId, permalink) {
            // Hide all thread charts
            document.querySelectorAll('.thread-charts').forEach(el => {
                el.style.display = 'none';
            });
            
            // Show selected thread
            const selectedThread = document.getElementById('thread-' + postId);
            if (selectedThread) {
                selectedThread.style.display = 'block';
                // Trigger resize for Plotly
                setTimeout(() => {
                    window.dispatchEvent(new Event('resize'));
                }, 100);
            }
            
            // Update "View Thread" link
            const viewLink = document.getElementById('view-thread-link');
            if (viewLink && permalink) {
                viewLink.href = permalink;
            }
        }
